import React, { Component } from 'react';
import { Nav, NavDropdown } from 'react-bootstrap';
import '../styles/CategoryMenu.css';

class CatagoryMenu extends Component {

	constructor(props) {
		super(props);
		this.state = { isOpen: false };
	}

	handleOpen = () => {
		this.setState({ isOpen: true });
	};

	render() {
		return (
			<Nav justify variant="pills" defaultActiveKey="/home" as="ul" >

				<NavDropdown title="Clothing" onMouseEnter={alert('dddd')} id="nav-dropdown">
					<NavDropdown.Item eventKey="1.1">Tops</NavDropdown.Item>
					<NavDropdown.Item eventKey="1.2">Bottoms</NavDropdown.Item>
					<NavDropdown.Item eventKey="1.3">Dress</NavDropdown.Item>
				</NavDropdown>

				<NavDropdown title="SportWear" id="nav-dropdown">
					<NavDropdown.Item eventKey="2.1">Excercis</NavDropdown.Item>
					<NavDropdown.Item eventKey="2.2">Shoes</NavDropdown.Item>
					<NavDropdown.Item eventKey="3.3">Flixable</NavDropdown.Item>
				</NavDropdown>

				<NavDropdown title="Outerwear" id="nav-dropdown">
					<NavDropdown.Item eventKey="3.1">Jacket</NavDropdown.Item>
					<NavDropdown.Item eventKey="3.2">Sweater</NavDropdown.Item>
					<NavDropdown.Item eventKey="3.3">Coat</NavDropdown.Item>
				</NavDropdown>

				<NavDropdown title="Bags" id="nav-dropdown">
					<NavDropdown.Item eventKey="4.1">Hand Bag</NavDropdown.Item>
					<NavDropdown.Item eventKey="4.2">Shoulder Bag</NavDropdown.Item>
					<NavDropdown.Item eventKey="4.3">Backpack</NavDropdown.Item>
				</NavDropdown>

				<NavDropdown title="Shoses" id="nav-dropdown">
					<NavDropdown.Item eventKey="5.1">Sport Shose</NavDropdown.Item>
					<NavDropdown.Item eventKey="5.2">Boots</NavDropdown.Item>
					<NavDropdown.Item eventKey="5.3">Casual Shoes</NavDropdown.Item>
				</NavDropdown>

				<NavDropdown title="Beauty" id="nav-dropdown">
					<NavDropdown.Item eventKey="6.1">Makeup</NavDropdown.Item>
					<NavDropdown.Item eventKey="6.2">Hair Car</NavDropdown.Item>
					<NavDropdown.Item eventKey="6.3">Skin Car</NavDropdown.Item>
				</NavDropdown>

				<NavDropdown title="Accessories" id="nav-dropdown">
					<NavDropdown.Item eventKey="7.1">Belts</NavDropdown.Item>
					<NavDropdown.Item eventKey="7.2">Glasses</NavDropdown.Item>
					<NavDropdown.Item eventKey="7.3">Neckles</NavDropdown.Item>
				</NavDropdown>
			</Nav >
		);
	}
}

export default CatagoryMenu;
